export const altaMedicoRequest = (data, setMedicoData, setFeching) => {
    setFeching(true)
	const options = {
		method: 'POST',
		headers: {
			'Accept': 'application/json',
			'Content-Type': 'application/json'
		},
		origin: 'http://localhost:3000',
		referrer: 'http://localhost:8080',
		cache: "default",
		body: JSON.stringify(data)
	}
	fetch('http://localhost:8080/users/altaMedico', options)
		.then(res => res.json().then(res => {
			setMedicoData(res)
			setFeching(false)
		})).catch((error) => {
			setFeching(false)
			console.log(error)
